\n\nEM 06/03/17 FIZ CONTATO COM A SENHORA VANILDA VICE DIRETORA DO HC PIRAPORINHA E ELA ME INFORMOU QUE DEVIDO O CASO DA DONA LEONICE EXIGIR UMA CERTA URGENCIA E PARA VIBIALIZAR O ATENDIMENTO PROVAVELMENTE FOI POR ISSO QUE UBS QUE ATENDEU A DONA LEONICE ENCAMINHOU ELA PARA O AMA MAUA, CASO ELA QUEIRA FAZER ESSES EXAMES E DAR CONTINUIDADE NO TRATAMENTO POR DIADEMA, ELA TEM QUE AGENDAR UMA NOVA CONSULTA COM O ESPECIALISTA E RECOMEÇAR TUDO DE NOVO, O QUE NÃO É VIAVEL PARA ELA. \n\n07/03/2017 foi feito contato com o AMA Maua onde fui informado que eles não tem esse tipo de exame, e que a guia de exame da dona Eunice estava na fila de espera sem previsão, e quando eles tiverem alguma novidade eles ligariam para a dona Eunice. Feito contato com a SENHORA VANILDA DO HM E ELA ME INFORMOU QUE IA VER A POSSIBILIDADE DE FAZER ESSE EXAME POR DIADEMA, MAS QUE POSSIVELMENTE IA PRECISAR DE UM NOVO RELATORIO MEDICO E NOVA GUIA COM OS CARIMBOS DE DIADEMA. FEITO CONTATO COM A DONA EUNICE E PASSADO TODAS ESSAS INFORMAÇÕES PARA ELA E ELA ME DISSE QUE NO DIA 09/03/2017 RETORNARIA EM CONSULTA MEDICA E IA INFORMAR PARA A MEDICA DELA TODO ESSE TRANSTORNO E QUE POSTERIOR ME INFORMARIA O QUE HAVIA SIDO RESOLVIDO. \n\n15 DE MARÇO DE 2017 A DONA LEONICE ME INFORMOU QUE HAVIA RETORNADO COM SUA MÉDICA E A MÉDICA HAVIA EMITIDO UMA NOVA GUIA DE ENXAME PARA ELA COM PEDIDO DE URGENCIA E ENCAMINHADO A GUIA PARA A UBS NAÇÕES QUE POSTERIOR ENCAMINHARIA PARA O QUARTEIRÃO DA SAUDE PARA AGENDAMENTO.\n\n24/04/17 FOI REALIZADO O EXAME DA DONA LEONICE.\nEM 11/05/17 FEITO CONTATO COM A DONA LEONICE ONDE ELA AGRADECEU PELO EMPENHO DO GABINETE NESSE PROCESSO. FINALIZANDO ESSA DEMANDA. ","5 - Finalizado","","2017-05-11","5026");
